INSERT INTO `saas_cms_article` (`id`, `site_id`, `category_id`, `title`, `intro`, `summary`, `image`, `author`, `content`, `visit`, `visit_virtual`, `is_show`, `sort`, `create_time`, `update_time`) VALUES (6, 100005, 5, '关于我们', '我们是一个数码销售回收平台，深耕数码数十余年，业务主要分布在河北地区，公司地址在河北省石家庄太和大厦', '我司的业务范围，服务宗旨，企业价值。', '', '', '<h1 style=\"text-align: center;\"><span style=\"color: var(--tw-prose-bold);\"><strong>企业简介</strong></span></h1><p style=\"text-align: start;\"> &nbsp; &nbsp; &nbsp; &nbsp;作为河北省石家庄市一家领先的数码产品<strong>销售及回收</strong>平台，我们的公司自成立以来便专注于<strong>数码领域</strong>，积累了逾十年的行业经验。我们的业务覆盖整个<strong>河北地区</strong>，公司办公室位于<strong>石家庄太和大厦6楼A37号。</strong></p><p style=\"text-align: start;\"> &nbsp; &nbsp; &nbsp; &nbsp;我们公司的核心竞争力在于能够提供高于市场的回收价格范围从50元至500元不等，确保客户在交易过程中获得最大的经济利益。公司每日管理的二手数码产品库存量超过<span style=\"color: rgb(225, 60, 57);\">2000</span>件，产品涵盖<strong>苹果手机全系列、苹果电脑全系列、苹果平板全系列、华为折叠屏、Mate系列及P系列，以及其他品牌的安卓手机、平板和原装配件。</strong></p><p style=\"text-align: start;\"> &nbsp; &nbsp; &nbsp; &nbsp;公司组织架构完善，包括回收部、质检部、售后服务部、销售部以及管理层。这一多部门的协调运作，确保了公司作为一个有实力的回收销售商家的市场地位。</p><p style=\"text-align: start;\"> &nbsp; &nbsp; &nbsp; &nbsp;在运营效率方面，我们公司在回收业务中以<strong>高效率、快速高质量质检和秒速打款</strong>著称，在销售方面以二手机<strong>包售后，秒发货</strong>为服务宗旨。</p><p style=\"text-align: start;\"> &nbsp; &nbsp; &nbsp; &nbsp;同时，我们也在不断投资研发，以优化技术和服务。目前，我们正在开发先进的线上销售平台和回收平台，以提供更优质的用户体验，<strong>秉承着为客户创造价值的使命。</strong></p><p style=\"text-align: start;\"><br></p>', 0, 100, 1, 0, 1713409364, 1714675401);
